					["colorFunc"] = "function(progress, r1, g1, b1, a1, r2, g2, b2, a2)\n    local region = WeakAuras.regions[aura_env.id].region\n    local bar = region.bar\n    \n    aura_env.determineOrder()\n    \n    local _, _, _, startTime, endTime = UnitCastingInfo(aura_env.unit) \n    if startTime and endTime then\n        local width = aura_env.widthPerSegment * (GetTime() * 1000 - startTime) / (endTime - startTime)\n        if width == 0 then\n            width = 0.01\n        end\n        bar.cast:SetWidth(width)\n        bar.cast:ClearAllPoints()\n        bar.cast:SetPoint(\"LEFT\", bar.fg, \"RIGHT\", 0, 0)\n        bar.cast:Show()\n    else\n        bar.cast:Hide()\n    end\n    \n    local firstRendDone = false\n    for i = 1, 5 do\n        local target = aura_env.prev[i] or aura_env.order[i] or 0\n        if target > 0 then\n            local text = aura_env.getSpellText(target)\n            if target == 2 and firstRendDone then\n                text = \"range\"\n            elseif target == 2 then\n                text = \"melee\"\n                firstRendDone = true\n            end\n            bar.texts[i]:SetText(text)\n            bar.texts[i]:ClearAllPoints()\n            bar.texts[i]:SetPoint(\"LEFT\", bar, \"LEFT\", aura_env.widthPerSegment*(i-1), 0)\n            bar.texts[i]:Show()\n        else\n            bar.texts[i]:Hide()\n        end \n    end\n    \n    if aura_env.isMythic then\n        local next = aura_env.combo + (aura_env.target and 2 or 1)\n        if next <= 2 then\n            bar.texts[next]:SetText(aura_env.getNextSpells(next))\n            bar.texts[next]:ClearAllPoints()\n            bar.texts[next]:SetPoint(\"LEFT\", bar, \"LEFT\", aura_env.widthPerSegment*(next-1), 0)\n            bar.texts[next]:Show()\n        end\n    end\n    return r1, g1, b1, a1\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
