			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["custom"] = "aura_env.phase = 1\naura_env.isMythic = false\n\naura_env.unit = \"boss1\"\n\naura_env.aegis = 244894 --Corrupt Aegis\naura_env.technique = 244688 --Taeshalach Technique\naura_env.spells = {\n    --[[\n    [2061] = 1,\n    [2060] = 2,\n    [596] = 3,\n    ]]\n    [245458] = 1, --Foe Breaker\n    [255059] = 1, --Empowered Foe Breaker\n    [245463] = 2, --Flame Rend\n    [255058] = 2, --Empowered Flame Rend\n    [245301] = 3, --Searing Tempest\n    [255061] = 3, --Empowered Searing Tempest\n}\n\naura_env.targets = {\n    \"tank\", --Foe Breaker\n    \"melee\", --Flame Rend\n    \"aoe\", --Searing Tempest\n}\naura_env.target = nil\n\naura_env.icons = {\n    135811,\n    460698,\n    135826,\n}\n\naura_env.regularOrder = {\n    1,\n    2,\n    1,\n    2,\n    3\n}\n\naura_env.mythicOrders = {\n    [1] = {\n        [2] = {\n            1, 2, 3, 1, 2\n        },\n        [3] = {\n            1, 3, 2, 1, 2\n        }\n    },\n    [2] = {\n        [1] = {\n            2, 1, 1, 3, 2\n        },\n        [3] = {\n            2, 3, 1, 1, 2\n        }\n    }\n}\n\naura_env.determineOrder = function()\n    if not aura_env.isMythic then\n        aura_env.order = aura_env.regularOrder\n    else\n        local first, second = (aura_env.prev[1] or 0), (aura_env.prev[2] or 0)\n        if first > 0 and second > 0 then\n            aura_env.order = aura_env.mythicOrders[first][second]\n        end\n    end\nend\n\naura_env.clearCombo = function()\n    aura_env.combo = 0\n    aura_env.prev = {}\n    aura_env.order = {}\n    aura_env.counts = {\n        0,\n        0,\n        0,\n    }\nend\naura_env.clearCombo()\n\naura_env.getSpellIcon = function(target)\n    return string.format(\"|T%s:0|t\", aura_env.icons[target])\nend\n\naura_env.getSpellText = function(target)\n    if target == 2 and aura_env.counts[2] > 1 then\n        text = \"range\"\n    elseif target == 2 then\n        text = \"melee\"\n    else\n        text = aura_env.targets[target]\n    end\n    return string.format(\"%s %s\", aura_env.getSpellIcon(target), text)\nend\n\naura_env.getNextSpells = function(next)\n    if next == 1 then\n        return aura_env.getSpellText(1)..\"\\n\"..aura_env.getSpellText(2)\n    elseif next == 2 then\n        local other = (aura_env.prev[1] % 2) + 1\n        return aura_env.getSpellText(other)..\"\\n\"..aura_env.getSpellText(3)\n    end\nend\n\n--frame stuff\nlocal region = WeakAuras.regions[aura_env.id].region\nlocal bar = region.bar\naura_env.widthPerSegment = bar:GetWidth() / 5\nif not bar.sparks then bar.sparks = {} end\nfor i = 1, 4 do\n    if bar.sparks[i] then bar.sparks[i]:Hide() end\n    local spark = bar:CreateTexture(nil, \"ARTWORK\")\n    spark:SetDrawLayer(\"ARTWORK\", 4)\n    spark:SetTexture(bar.spark:GetTexture())\n    spark:SetWidth(bar.spark:GetWidth())\n    spark:SetHeight(bar.spark:GetHeight())\n    spark:SetBlendMode(bar.spark:GetBlendMode())    \n    spark:ClearAllPoints()\n    spark:SetPoint(\"LEFT\", bar, \"LEFT\", aura_env.widthPerSegment*i, 0)\n    bar.sparks[i] = spark\nend\nif not bar.texts then bar.texts = {} end\nfor i = 1, 5 do\n    if bar.texts[i] then bar.texts[i]:Hide() end\n    local text = bar:CreateFontString(nil, \"OVERLAY\", \"GameFontHighlight\")\n    text:SetFont(region.text:GetFont())\n    text:SetWidth(aura_env.widthPerSegment)\n    text:SetHeight(bar:GetHeight())\n    text:SetWordWrap(true)\n    bar.texts[i] = text\nend\nif bar.cast then bar.cast:Hide() end\nlocal cast = bar:CreateTexture(nil, \"ARTWORK\")\ncast:SetDrawLayer(\"ARTWORK\", 3)\ncast:SetTexture(bar:GetTexture())\ncast:SetBlendMode(\"ALPHAKEY\")\ncast:SetVertexColor(bar:GetVertexColor())\ncast:SetWidth(1)\ncast:SetHeight(bar:GetHeight())\nbar.cast = cast\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
