				["custom"] = "function(event, ...)\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local _, subEvent, _, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags = CombatLogGetCurrentEventInfo()\n        if subEvent == \"SPELL_AURA_REMOVED\" then\n            local spellID = select(12, CombatLogGetCurrentEventInfo())\n            if spellID == aura_env.aegis then\n                aura_env.phase = aura_env.phase + 1\n            end\n        end\n    elseif event == \"ENCOUNTER_START\" then\n        local encounterID, _, difficultyID = ...\n        aura_env.phase = 1\n        aura_env.isMythic = (difficultyID == 16)\n    elseif event == \"UNIT_SPELLCAST_START\" then\n        local unit, _, spellID = ...\n        if unit == aura_env.unit and aura_env.spells[spellID] then\n            aura_env.target = aura_env.spells[spellID]\n            aura_env.counts[aura_env.target] = aura_env.counts[aura_env.target] + 1\n            aura_env.prev[aura_env.combo+1] = aura_env.target\n        end\n    elseif event == \"UNIT_SPELLCAST_SUCCEEDED\" then\n        local unit, _, spellID = ...        \n        if unit == aura_env.unit and spellID == aura_env.technique then\n            aura_env.clearCombo()\n            return true\n        elseif unit == aura_env.unit and aura_env.spells[spellID] then\n            aura_env.combo = aura_env.combo + 1\n            aura_env.target = nil\n            return aura_env.combo < 5\n        end\n    end\nend",
